import PropTypes from "prop-types";

const foodList = [
  {
    id: 3,
    name: "a",
    image: "data:image/jpeg;base64,",
    rating: 5
  },
  {
    id: 1,
    name: "b",
    image: "data:image/jpeg;base64,",
    rating: 3
  },
  {
    id: 2,
    name: "c",
    image: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTO8HOYYpfX5sGSFXj4HoTAkNQ0UVWbsDr0fg&usqp=CAU",
    rating: 4
  }
];

function Food(props) {
  return (
    <div>
      <h1>I like {props.name}</h1>
      <img src={props.image} alt={props.name} />
    </div>
  );
}

Food.PropTypes = {
  name: PropTypes.string,
  image: PropTypes.string,
  rating: PropTypes.number
};

function rederFood(dish) {
  console.log(dish);
  return <Food key={dish.id} name={dish.name} image={dish.image} />

}

function App() {
  return (
    <div className="App">
      {foodList.map(rederFood)};
    </div>
  );
}

export default App;
